import React from "react";
import { Card } from "./card/Card";
import { Button } from "../../components/button";
import "../../Shared.css";

interface VideoHTMLAttributes {
    height?: number | string;
    playsInline?: boolean;
    poster?: string;
    width?: number | string;
    controls: string;
    autoplay: string;
    name: string;
}

const Dashboard = (video: VideoHTMLAttributes) => {
  return (
    <div className="d-flex justify-content-center align-items-center h-100 flex-column">
      <Card />
      <div className="heading__primary mt-2 text-white">Carly Rae Jepsen</div>
      <div className="heading__secondary m-3 text-center">
        Cut To The Feeling
      </div>
      <video controls autoplay name="media">
        <source
          src="https://p.scdn.co/mp3-preview/b326e03624cb098d8387e17aa46669edac0d025a?cid=774b29d4f13844c495f206cafdad9c86"
          type="audio/mpeg"
        />
      </video>
      <Button
        type={"primary"}
        title={"Add to playlist"}
        action={() => {}}
        fill={"rgb(255, 78, 80)"}
      />
    </div>
  );
};

export default Dashboard;
